import head from './Header.module.css'
import logo from '../../img/logo.png'
const Header = () => {
    return(
        <header className={head.header}>
            <img className={head.header_img} src={logo} alt={"logo"}/>
            <div></div>
        </header>
    );
}

export default Header;
